func TestELEMENT25IsRandom(t *testing.T) {
	for i := 0; i < 1000; i++ {
		var x, y Element25
		x.SetRandom()
		y.SetRandom()
		if x.Equal(&y) {
			t.Fatal("2 random numbers are unlikely to be equal")
		}
	}
}

